import React from 'react';
import './header.css';
import people from '../../assets/people.png';
import ai from '../../assets/ai.png';

const Header = () => {
  return (
    <div className="gpt3__header section__padding" id="home">
    <div className="gpt3__header-content">
      <h1 className="gradient__text">Let's Build Something amazing with GPT-3 OpenAI</h1>

      <p>Welcome to the ultimate course, where you will learn how to take Figma designs, turn them into four modern, responsive, beautifully-designed applications, and get hired as a front-end developer. All the way from design, over development, to deployment on your own web development portfolio!</p>

      <div className="gpt3__header-content__input"> 
        <input type="email" placeholder="Your Email Address"/>
        <button type="button">Get Started</button>
      </div>

      <div className="gpt3__header-content__people">
        <img src={people} alt="people"/>
        <p>1.600 people requested access a visit in last 24 hours</p>
      </div>
      </div>

       <div className="gpt3__header-image">
          <img src={ai} alt="ai" />
       </div>
     </div>
  )
}

export default Header
